import { useState } from "react";

function Button({ colour, index }) {
    const [isHovered, setIsHovered] = useState(false);
    const onMouseEnter =()=>{
        setIsHovered(true)
    }

    return (
            <button
                key={index}
                className="colour"
                id={colour}
                onMouseEnter={onMouseEnter}
                onMouseLeave={onMouseLeave}
                style={{ backgroundColor: colour }}
            >
            </button>
    );
}

export default Button;
